INSERT INTO `movies` VALUES ('1', '1;', '10', '《X战警逆转未来》', '9.0000', '7', '故事的设定发生在当下，变种人族群遭到了前所未有的毁灭性打击，而这一切的根源是“魔形女”瑞文（詹妮弗·劳伦斯 Jennifer Lawrence 饰）在1973年刺杀了玻利瓦尔·特拉斯克（彼特·丁拉基 Peter Dinklage 饰）。在得知“幻影猫”（艾伦·佩吉 E llen Page 饰）利用穿越时空的能力帮助Blink（范冰冰 饰）等战友逃脱巨型机器人“哨兵”的追杀后，X教授（帕特里克·斯图尔特 Patrick Stewart 饰）和万磁王（伊恩·麦克莱恩 Ian McKellen 饰）达成认同，决定让金刚狼（休·杰克曼 Hugh Jackman 饰）穿越回1973年，找到年轻的X教授（詹姆斯·麦卡沃伊 James McAvoy 饰）和年轻的万磁王（迈克尔·法斯宾德 Michael Fassbender 饰）并说服他们一起阻止魔形女的行动。于是，金刚狼踏上了回到过去的旅程，但是命运会不会发生逆转，任何人都无从知晓。', null, '39.00', '1', '2018-12-16 17:01:48', '125', '/merHeadCreateImage/2/f/E5D03F4F938648BEA55B43B85A69DB96_4.mp4', '3D');
INSERT INTO `movies` VALUES ('2', '1;', '10', '《变形金刚5最后的骑士》', '8.0000', '0', '地球陷入毁灭危机，擎天柱失踪，越来越多的汽车人和霸天虎来到地球，前海豹突击队成员威廉·伦诺克斯（ 乔什·杜哈明饰）成为了政府军组建的TRF中的一员，负责绞杀地球上的汽车人——不论好坏。在芝加哥街头，伦诺克斯遇到了凯德·伊格尔（马克·沃尔伯格饰）孤儿伊莎贝拉（伊莎贝拉·莫奈饰）。凯德因为帮助、支持汽车人而成为政府通缉犯，所以他在一个垃圾场看管着一群幸存的汽车人。与此同时，失踪的擎天柱被女巫昆塔莎黑化，要毁灭地球。拯救世界的责任于是落在了这支由凯德为首的非同寻常的队伍身上，大黄蜂、一位英国爵士（安东尼·霍普金斯饰）还有一位牛津大学教授（劳拉·哈德克饰），一场史诗浩劫彻底将地球变成了战场 。', null, '59.99', '1', '2018-12-16 17:08:28', '127', '/merHeadCreateImage/2/f/EB16EB2211194AA59348062B2F89C64F_4.mp4', '3D');
INSERT INTO `movies` VALUES ('3', '1;', '10', '《复仇者联盟3无限战争》', '7.0000', '0', '《复仇者联盟3：无限战争》是漫威电影宇宙10周年的历史性集结，将为影迷们带来史诗版的终极对决。面对灭霸突然发起的闪电袭击，复仇者联盟及其所有超级英雄盟友必须全力以赴，才能阻止他对全宇宙造成毁灭性的打击。', null, '29.00', '1', '2018-12-16 17:11:29', '116', '/merHeadCreateImage/2/f/5FF166A160224031AF8A4435E16A37C7_4.mp4', '3D');
INSERT INTO `movies` VALUES ('4', '1;', '10', '《巨齿鲨》', '7.0000', '1', '一项由中国主导的国际科研项目，正在马里亚纳海沟深处进行时，遭遇未知生物攻击，科研人员被困海底。前美国海军陆战队深海潜水专家乔纳斯·泰勒受命前往营救，再度遭遇数年前曾经在深海给自己留下终身难以磨灭记忆的史前生物巨齿鲨。乔纳斯联手科研项目中的中国女科学家张苏茵成功营救了被困人员，但营救行动却意外造成了巨齿鲨逃离深海。当史前巨兽重返浅海，人类将为自己对大自然的贪婪付出惨重的代价......', null, '43.00', '1', '2018-12-16 17:14:22', '119', '/merHeadCreateImage/2/f/4B8536F238684C4DA36A05B567B3DDA7_4.mp4', '3D');
INSERT INTO `movies` VALUES ('5', '1;', '10', '《狂暴巨兽》', '6.0000', '0', '灵长类动物学家戴维斯·欧科依（道恩·强森饰）一直与人类保持距离，却与极为聪明的、他自幼抚养长大的银背大猩猩乔治感情深厚，但一次基因实验却使温驯的乔治突变为了狂怒的庞然巨兽。更可怕的是，其他动物也发生了同样基因异变，还有巨狼和巨鳄。三只“顶级掠食者”组团暴击人类世界，将美国折腾得天翻地覆。欧科依必须阻止这场全球性的灾难，关键时刻，他挺身而出组队拯救危机和人类世界，也试图找到拯救并挽回昔日挚友乔治的一线希望。\r\n某实验室高科技装置突然出了问题，让卫星掉落到美国圣地亚哥动物园，制造了猩猩、蜥蜴和狼三个大怪兽。怪兽开始袭击美国各地，道恩·强森扮演的前海军陆战队成员一人对战三大怪兽。道恩·强森扮演的前海军陆战队成员一人对战三大怪兽（猩猩、蜥蜴、狼），影片改编自1980年代街机游戏，故事发生在美国芝加哥附近。', null, '44.00', '1', '2018-12-16 17:17:33', '145', '/merHeadCreateImage/2/f/C7192869DAAE4386B548C3FEB764AE96_4.mp4', '3D');
INSERT INTO `movies` VALUES ('6', '1;', '10', '《神奇女侠》', '7.0000', '0', '戴安娜（盖尔·加朵 Gal Gadot 饰）是女王希波吕忒（康妮·尼尔森 Connie Nielsen 饰）的女儿，自幼生活在天堂岛上。巨大的屏障将这座岛屿同外界的纷纷扰扰隔开犹如一个世外桃源，而岛上生活着的亦都是女性。在女武官安提奥普（罗宾·莱特 Robin Wright 饰）的教导之下，戴安娜习得了高强的武艺，而她的体内，似乎隐藏着某种强大的未知力量。 一场意外中，一位名为史蒂夫（克里斯·派恩 Chris Pine 饰）的男子来到了岛上，从他口中，戴安娜得知外面的世界正在经历战争的磨难，而造成这一切的罪魁祸首，是战神阿瑞斯（大卫·休里斯 David Thewlis 饰）。为了拯救人类于水火之中，戴安娜依然拿起了长剑与盾牌，发誓要彻底摧毁阿瑞斯的阴谋。', null, '45.00', '1', '2018-12-16 17:22:16', '136', '/merHeadCreateImage/2/f/0F104841987C4DAE9935B4B919B615A3_4.mp4', '3D');
INSERT INTO `movies` VALUES ('7', '1;', '10', '《头号玩家》', '5.0000', '0', '故事发生在2045年，虚拟现实技术已经渗透到了人类生活的每一个角落。詹姆斯哈利迪（马克·里朗斯 Mark Rylance 饰）一手建造了名为“绿洲”的虚拟现实游戏世界，临终前，他宣布自己在游戏中设置了一个彩蛋，找到这枚彩蛋的人即可成为绿洲的继承人。要找到这枚彩蛋，必须先获得三把钥匙，而寻找钥匙的线索就隐藏在詹姆斯的过往之中。 韦德（泰尔·谢里丹 Tye Sheridan 饰）、艾奇（丽娜·维特 Lena Waithe 饰）、大东（森崎温 饰）和修（赵家正 饰）是游戏中的好友，和之后遇见的阿尔忒弥斯（奥利维亚·库克 Olivia Cooke 饰）一起，五人踏上了寻找彩蛋的征程。他们所要对抗的，是名为诺兰索伦托（本·门德尔森 Ben Mendelsohn 饰）的大资本家。', null, '46.00', '1', '2018-12-16 17:24:27', '125', '/merHeadCreateImage/2/f/EB0E1060986840359BA3B7F48A56F704_4.mp4', '3D');
INSERT INTO `movies` VALUES ('8', '1;', '10', '《正义联盟》', '4.0000', '0', '《正义联盟》故事将承接《蝙蝠侠大战超人：正义黎明》的结局，蝙蝠侠（本·阿弗莱克饰）在对人类残存的信心以及超人（亨利·卡维尔饰）无私奉献的影响下，接受了新盟友——神奇女侠（盖尔·加朵饰）的帮助，去对抗更加强大的敌人。蝙蝠侠和神奇女侠一同寻找并招募了一支超人类联盟来抵挡新觉醒的威胁。但尽管这支队伍集结了蝙蝠侠、神奇女侠、闪电侠（埃兹拉·米勒饰）、海王（杰森·莫玛饰）和钢骨（雷·费舍饰），他们似乎无法阻止敌人对地球的进攻', null, '47.00', '1', '2018-12-16 17:27:39', '121', '/merHeadCreateImage/2/f/FE31AC5DA8CE4AF1981967116810587C_4.mp4', '3D');
INSERT INTO `movies` VALUES ('9', '1;', '10', '《蜘蛛侠:英雄归来》', '3.0000', '0', '在战机场大战落幕后，彼得·帕克回归普通的高中生生涯。在恩师托尼·斯塔克协助下，他试图在普通高中生和打击犯罪的超级英雄蜘蛛侠间保持平衡，托尼在身为导师的身份之下，希望彼得负责街头的灰色地带就好。但好景不长，一批银行歹徒改造了遗留在纽约各地的外星武器，也使他面临全新的威胁——反派秃鹫。', null, '99.00', '1', '2018-12-16 17:30:04', '129', '/merHeadCreateImage/2/f/692A638AB7754088A5B704A28FCDC521_4.mp4', '3D');
INSERT INTO `movies` VALUES ('10', '1;', '10', '《侏罗纪世界2》', '2.0000', '0', '自侏罗纪世界的骚乱以来，种类繁多的恐龙在努布拉岛度过了三年无拘无束的时光。然而该岛火山活动频繁，随时有喷发的危险。致力于恐龙保护的克莱尔·戴宁（布莱丝·达拉斯·霍华德 Bryce Dallas Howard 饰）受到班杰明?洛克伍德的邀请。班杰明及其下属伊莱·米尔斯（拉菲·斯波 Rafe Spall 饰）希望她和相关技术人员前往努布拉岛拯救那里的恐龙，并将它们安置在新的栖息地。受到感染的克莱尔设法找来欧文（克里斯·帕拉特 Chris Pratt 饰）一同前往，欧文则希望救出他亲手驯养的迅猛龙小蓝。当他们踏足这座隔绝之岛时，却发现事情没那么简单。 火山蠢蠢欲动，随时爆发，而混乱之中丑恶的阴谋悄然酝酿……', null, '39.00', '1', '2018-12-16 17:33:18', '133', '/merHeadCreateImage/2/f/622EA05917AF4D5F82FD95A0662EA1FC_4.mp4', '3D');
INSERT INTO `movies` VALUES ('11', '1;', '10', '《战狼2》', '1.0000', '1', '故事发生在非洲附近的大海上，主人公冷锋遭遇人生滑铁卢，被“开除军籍”，\r\n本想漂泊一生的他，正当他打算这么做的时候，一场突如其来的意外打破了他的计划，\r\n突然被卷入了一场非洲国家叛乱，本可以安全撤离，却因无法忘记曾经为军人的使命，\r\n孤身犯险冲回沦陷区，带领身陷屠杀中的同胞和难民，展开生死逃亡。随着斗争的持续，\r\n体内的狼性逐渐复苏，最终孤身闯入战乱区域，为同胞而战斗。', null, '59.00', '1', '2018-12-16 17:36:42', '133', '/merHeadCreateImage/2/f/84DBDEB8A5784D5A92E3C44944DA32C1_4.mp4', '2D');
INSERT INTO `movies` VALUES ('12', '1;', '10', '《英伦对决》', '2.0000', '4', '关玉明年轻时打过越战,当过特种兵。但如今,他敛尽锋芒，在英国伦敦唐人街开了一家小餐馆,\r\n与女儿相依为命。在一次恐怖袭击中，女儿不幸遇难。英国有关部门的不作为更使他悲愤莫名，\r\n这时，关键人物汉尼斯出现在他的视野之中，担任政府高官的他当年曾与恐怖分子有千丝万缕联系。\r\n曾经在战争中出生入死的经验，让关玉明敏锐地察觉，汉尼斯手中一定有此次恐怖袭击的资料。\r\n于是，关玉明几次登门请求汉尼斯为自己提供线索，但遭到汉尼斯的拒绝。\r\n万念俱灰的关玉明决定用自己的方式为女儿报仇雪恨。为此，他拒绝了爱人林宝怡的挽留，\r\n独自踏上向恐怖组织以牙还牙以血还血的复仇之路。但他并不知道的是，一个错综复杂的大阴谋正在他面前徐徐展开……', null, '38.00', '1', '2018-12-16 17:40:10', '145', '/merHeadCreateImage/2/f/C30FD9B3976244858E45482B32FD6735_4.mp4', '2D');
INSERT INTO `movies` VALUES ('13', '1;', '10', '《悟空传》', '3.0000', '0', '这不是西游记的任何章节，这是悟空的故事，彼时孙悟空还不是震撼天地的齐天大圣，\r\n他只是只桀傲不驯的猴子。天庭毁掉他的花果山以掌控众生命运，他便决心跟天庭对抗，\r\n毁掉一切戒律。在天庭，孙悟空遇到不能爱的阿紫，一生的宿敌杨戬，和思念昔日爱人阿月的天蓬，\r\n他们的身份注定永生相杀，但其实不甘命运摆布的又何止孙悟空一人？\r\n却没想到反抗却带来更大的浩劫。他们所做的一切，究竟是不知天高地厚的热血轻狂，\r\n还是无奈宿命难改的压抑绝望？难道命运真的早已注定？悟空不服，他再次挥动金箍棒，\r\n要让这诸佛都烟消云散!', null, '48.00', '1', '2018-12-16 17:43:51', '145', '/merHeadCreateImage/2/f/4F52EDC22F04408E9EAEF6C585179A20_4.mp4', '2D');
INSERT INTO `movies` VALUES ('14', '1;', '10', '《西游·降魔篇》', '4.0000', '0', '受气的唐僧、暴戾的孙悟空、帅气的猪八戒、妩媚的沙僧，完全颠覆版西游记，周星驰时隔15年自编自导再战西游。\r\n这是个妖魔横行的世界，百姓苦不堪言。年轻的驱魔人玄奘以“舍小我，成大我”的大无畏精神，\r\n历尽艰难险阻，依次收复水妖、猪妖以及妖王之王孙悟空为徒，并用“爱”将他们感化，\r\n而玄奘自己也终于领悟到了“大爱”的真意。为救天下苍生于水火，为赎还自己的罪恶，\r\n师徒四人义无反顾的踏上了“下地狱”般的西行取经之路…… ', null, '49.10', '1', '2018-12-16 17:46:32', '122', '/merHeadCreateImage/2/f/EB65F9F2F9B844A4B7CEC7B9871780D3_4.mp4', '2D');
INSERT INTO `movies` VALUES ('15', '1;', '14', '《一出好戏》', '5.0000', '17', '马进欠下债务，与远房表弟小兴在底层社会摸爬滚打，习惯性的买彩票，\r\n企图一夜爆富，并迎娶自己的同事姗姗。一日，公司全体员工出海团建，\r\n途中，马进收到了彩票中头奖的信息，六千万！就在马进狂喜自己翻身的日子终于到来之际，\r\n一场突如其来的滔天巨浪打破了一切。苏醒过来的众人发现身处荒岛，丧失了一切与外界的联系…', null, '22.00', '1', '2018-12-16 17:51:48', '122', '/merHeadCreateImage/2/f/9A7F6A1C186A4B60A9755D9FB1B093F5_4.mp4', '2D');
INSERT INTO `movies` VALUES ('16', '1;', '10', '《羞羞的铁拳》', '6.0000', '0', '靠打假拳混日子的艾迪生（艾伦 饰），本来和正义感十足的体育记者马小（马丽 饰）是一对冤家，\r\n没想到因为一场意外的电击，男女身体互换。性别错乱后，两人互坑互害，\r\n引发了拳坛的大地震，也揭开了假拳界的秘密，惹来一堆麻烦，\r\n最终两人在“卷莲门”副掌门张茱萸（沈腾 饰）的指点下，向恶势力挥起了羞羞的铁拳。', null, '49.00', '1', '2018-12-16 17:54:37', '126', '/merHeadCreateImage/2/f/20A25E40BBFF4545AC61A8535126EA24_4.mp4', '2D');
INSERT INTO `movies` VALUES ('17', '1;', '10', '《西虹市首富》', '7.0000', '3', '《西虹市首富》的故事发生在《夏洛特烦恼》中的“特烦恼”之城“西虹市”。\r\n混迹于丙级业余足球队的守门员王多鱼，因比赛失利被开除离队。\r\n正处于人生最低谷的他接受了神秘台湾财团“一个月花光十亿资金”的挑战。\r\n本以为快乐生活就此开始，王多鱼却第一次感到“花钱特烦恼”！想要人生反转走上巅峰，真的没有那么简单。', null, '99.00', '1', '2018-12-16 17:59:58', '138', '/merHeadCreateImage/2/f/6B2794632FE4411ABD720FDA17820C16_4.mp4', '2D');
INSERT INTO `movies` VALUES ('18', '1;', '10', '《我不是药神》', '8.5000', '12', '一位不速之客的意外到访，打破了神油店老板程勇的平凡人生，他从一个交不起房租的男性保健品商贩，一跃成为印度仿制药“格列宁”的独家代理商。收获巨额利润的他，生活发生剧烈变化，被病患们冠以“药神”的称号。但是，一场关于救赎的拉锯战也在波涛暗涌中慢慢展开......', null, '29.00', '1', '2018-12-16 18:02:30', '155', '/merHeadCreateImage/2/f/2EA48BC94138414C9A0EECEBE170FE25_4.mp4', '2D');
INSERT INTO `movies` VALUES ('19', '1;', '10', '《唐人街探案》', '9.5000', '65', '天赋异禀的结巴少年“秦风”警校落榜，被姥姥遣送泰国找远房表舅——号称“唐人街第一神探”，实则“猥琐”大叔的“唐仁”散心。不想一夜花天酒地后，唐仁沦为离奇凶案嫌疑人，不得不和秦风亡命天涯…… 穷追不舍的警探——“疯狗”黄兰登；无敌幸运的警察——“草包”坤泰；穷凶极恶、阴差阳错的“匪帮三人组”；高深莫测的“唐人街教父”；“美艳风骚老板娘”……等悉数登场！七天！唐仁、秦风这对“欢喜冤家”、“天作之合”必须取长补短、同仇敌忾！他们能否在躲避警察追捕、匪帮追杀、黑帮围剿的同时，在短短“七天”内，完成找到“失落的黄金”、查明“真凶”、为自己“洗清罪名”这些“逆天”的任务？……', null, '30.00', '1', '2018-12-16 18:05:22', '125', '/merHeadCreateImage/2/f/595F8371E8014A3492D651FB83CA5560_4.mp4', '2D');
INSERT INTO `movies` VALUES ('20', '1;', '10', '《幕后玩家》', '9.6000', '6', '坐拥数亿财产的钟小年（徐峥饰），在事业如日中天之时却突遭意外，麻烦不断。在经过一系列的囧境后，逢凶化吉的他逐渐实现了自我救赎。', null, '40.00', '1', '2018-12-16 18:08:01', '126', '/merHeadCreateImage/2/f/AD1020B9566845AC9D3EE49429042267_4.mp4', '2D');
